import classes from './FashionSummary.module.css';

const FashionSummary = () => {
    return (
        <section className={classes.summary} >
            <h2>A New Revolution, A New Perspective</h2>
            <p>
                Choose your favouite fashion from our broad selection of available clothes & accessories
                and keep up with the latest fashion trends.
            </p>
            <p>
                All our clothes & accessories are came with high-quality based on new trends, just-in-time and 
                of course by experienced fashion designers!
            </p>
        </section>
    );
};

export default FashionSummary;
